import React from "react";
import { SearchProductItems } from "./style";
const SearchProductItem = props => {
    const {item} = props;
    console.log('item',  item);
    const {name, price, discount, avatar} = item
    return(
        <SearchProductItems className="search-product-item">
            <img src={avatar} alt={name}/>
            <div className="info">
                <h4 className="name-product">
                    {name}
                </h4>
                <span className="price">{price}</span>
            </div>
        </SearchProductItems>
    );
}
export default SearchProductItem;
